import React from 'react';
import ImgContact from 'src/assets/contact.png';

import Logo1 from 'src/assets/contact.png';
import Logo2 from 'src/assets/contact.png';
import Logo3 from 'src/assets/contact.png';
import Logo4 from 'src/assets/contact.png';

import {
  Container,
  ContentContainer,
  TitleContainer,
  ImageContact,
  ContainerContact,
  TitleContact,
  ParagraphContact,
  ContainerLogo,
  Logo,
} from './styles';

const Contact: React.FC = () => {
  return (
    <Container>
      <TitleContainer>Contact</TitleContainer>
      <ContentContainer>
        <ImageContact src={ImgContact} />
        <ContainerContact>
          <TitleContact>
            Questions ? Please contact us by e-mail below to request more
            information
          </TitleContact>
          <ParagraphContact>pedrohuugoo11@hotmail.com</ParagraphContact>
          <ContainerLogo>
            <Logo />
          </ContainerLogo>
        </ContainerContact>
      </ContentContainer>
    </Container>
  );
};

export default Contact;
